test_pack2/types.bal.newText:
type Address record {
	string street;
	string city;
	string zip;
};

type EmergencyContact record {
	string name;
	string relationship;
	string phone;
};

type Patient record {
	string name;
	string dob;
	string ssn;
	Address address;
	string phone;
	string email;
	string cardNo;
	EmergencyContact emergencyContact;
};

type Location record {
	string address;
	string city;
	string zip;
};

type DepartmentsItem record {
	string department_id;
	string name;
};

type HospitalInfo record {
	string hospital_id;
	string hospital;
	Location location;
	DepartmentsItem[] departments;
};

type Contact record {
	string phone;
	string email;
};

type Doctor record {
	string name;
	string specialization;
	int experience;
	Contact contact;
};

type Appointment record {
	Doctor doctor;
	string appointment_date;
	string status;
	string appointment_notes;
};

type Insurance record {
	string provider;
	string policy_number;
	int coverage;
};

type Billing record {
	string bill_id;
	int total_amount;
	int paid_amount;
	int due_amount;
	Insurance insurance;
};

type MedicationsItem record {
	string name;
	string dosage;
	string frequency;
};

type Pharmacy record {
	string name;
	string location;
};

type Prescription record {
	MedicationsItem[] medications;
	Pharmacy pharmacy;
};

type LabTestsItem record {
	string test_id;
	string test_name;
	string result;
	string date;
};

type RoomDetails record {
	string room_no;
	string bed_no;
	string room_type;
};

type Nurse record {
	string name;
	string shift;
	Contact contact;
};

type MyType record {
	Patient patient;
	HospitalInfo hospitalInfo;
	Appointment appointment;
	Billing billing;
	Prescription prescription;
	LabTestsItem[] labTests;
	RoomDetails roomDetails;
	Nurse nurse;
	string consultation_type;
};
